// src/components/Home.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const [pumps, setPumps] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5001/api/pumps')
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        if (data.success) {
          setPumps(data.pumps);
        }
      })
      .catch((error) => {
        console.error('Error fetching pumps:', error);
      });
  }, []);

  return (
    <div>
      <h1>Pumps List</h1>
      <div className="pump-list">
        {pumps.map((pump) => (
          <div key={pump._id}>
            <h2>{pump.name}</h2>
            <Link to={`/pumps/${pump._id}`}>Read More</Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
